// src/App.tsx
import React, { useState, useEffect } from "react";
import {
  createUserWithEmailAndPassword,
  signInWithEmailAndPassword,
  signOut,
  onAuthStateChanged,
  User
} from "firebase/auth";
import {
  doc,
  setDoc,
  getDoc
} from "firebase/firestore";
import { auth, db } from "./firebase";

type Profile = Record<string, any>;

declare module "firebase/auth" {
  interface User {
    profile?: Profile;
  }
}

function App() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState<"realtor" | "contractor">("realtor");
  const [user, setUser] = useState<User | null>(null);
  const [message, setMessage] = useState("");

  useEffect(() => {
    const unsub = onAuthStateChanged(auth, async (currentUser) => {
      if (currentUser) {
        // Try fetching from both collections
        const realtorRef = doc(db, "realtors", currentUser.uid);
        const contractorRef = doc(db, "contractors", currentUser.uid);
        const realtorSnap = await getDoc(realtorRef);
        if (realtorSnap.exists()) {
          currentUser.profile = realtorSnap.data() as Profile;
        } else {
          const contractorSnap = await getDoc(contractorRef);
          if (contractorSnap.exists()) {
            currentUser.profile = contractorSnap.data() as Profile;
          }
        }
        setUser(currentUser);
      } else {
        setUser(null);
      }
    });
    return () => unsub();
  }, []);

  const handleRegister = async () => {
    try {
      const cred = await createUserWithEmailAndPassword(auth, email, password);
      const uid = cred.user.uid;
      // Create profile document in chosen collection
      await setDoc(doc(db, `${role}s`, uid), {
        id: uid,
        email,
        name: "",
        photo: "",
        company: "",
        yearsExperience: 0,
        specialties: [],
        bio: "",
        role,
        connections: []
      });
      setMessage("Account & profile created!");
    } catch (error: any) {
      setMessage(error.message);
    }
  };

  const handleLogin = async () => {
    try {
      await signInWithEmailAndPassword(auth, email, password);
      setMessage("Logged in!");
    } catch (error: any) {
      setMessage(error.message);
    }
  };

  const handleLogout = async () => {
    try {
      await signOut(auth);
      setMessage("Logged out.");
    } catch (error: any) {
      setMessage(error.message);
    }
  };

  return (
    <div style={{ maxWidth: "400px", margin: "2rem auto", padding: "1rem", textAlign: "center", border: "1px solid #ccc", borderRadius: "8px" }}>
      <h2>Firebase Auth & Profile</h2>

      <input
        type="email"
        placeholder="Email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        style={{ display: "block", margin: "10px auto", width: "90%" }}
      />

      <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        style={{ display: "block", margin: "10px auto", width: "90%" }}
      />

      <div style={{ margin: "10px 0" }}>
        <label>
          <input
            type="radio"
            value="realtor"
            checked={role === "realtor"}
            onChange={() => setRole("realtor")}
          /> Realtor
        </label>
        <label style={{ marginLeft: "10px" }}>
          <input
            type="radio"
            value="contractor"
            checked={role === "contractor"}
            onChange={() => setRole("contractor")}
          /> Contractor
        </label>
      </div>

      <div style={{ margin: "10px 0" }}>
        <button onClick={handleRegister} style={{ marginRight: "10px" }}>Register</button>
        <button onClick={handleLogin} style={{ marginRight: "10px" }}>Login</button>
        <button onClick={handleLogout}>Logout</button>
      </div>

      <p style={{ color: "green" }}>{message}</p>

      {user ? (
        <div>
          <p>Logged in as: {user.email}</p>
          <pre style={{ textAlign: "left", whiteSpace: "pre-wrap" }}>{JSON.stringify(user.profile, null, 2)}</pre>
        </div>
      ) : (
        <p>No user logged in.</p>
      )}
    </div>
  );
}

export default App;
